var TabManager={initialize:function(e){var a=e,i=a.innerHeight();if(i>=50)for(;i>50;){var n=a.children("li:not(:last-child)"),l=n.length,t='<a class="dropdown-item" href="'+(d=$(n[l-1])).children("a").attr("href")+'" data-toggle="tab">'+d.text()+"</a>";a.find(".collapsed-tabs").prepend(t),d.remove(),i=a.innerHeight()}else{for(l=0;i<50&&a.children("li").length>0&&l++<20;){var r=a.find(".collapsed-tabs").children("a");if(!(l=r.length))break;var d=$(r[0]),t="<li class='nav-item'>\n<a href='"+d.attr("href")+"' data-toggle='tab'>"+d.text()+"</a>\n</li>";a.children("li.collapsed-menu").before(t),d.remove(),i=a.innerHeight()}i>50&&TabManager.initialize(e)}a.find(".collapsed-tabs").children("a").length?a.find(".collapsed-menu").show():a.find(".collapsed-menu").hide()}};$(function(){TabManager.initialize($(".nav-tabs-responsive")),$(window).resize(function(){TabManager.initialize($(".nav-tabs-responsive"))})});